    /// <summary>
    /// Class Letter Image
    /// </summary>
    public class LetterImage : Image
    {
        private ImageSource internalSource;
        private ColorUI currentColor;

        /// <summary>
        /// Get Index
        /// </summary>
        public int Index { get; private set; }

        /// <summary>
        /// Get Number
        /// </summary>
        public int Number { get; private set; }
        
        /// <summary>
        /// Get Letter
        /// </summary>
        public int Letter { get; private set; }

        /// <summary>
        /// GetIsVoted
        /// </summary>
        public bool Voted { get; private set; }

        /// <summary>
        /// Constructor of LetterImage
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="number"></param>
        /// <param name="index"></param>
        /// <param name="isVoted"></param> 
        /// <param name="colorUI"></param> 
        public LetterImage(string hash, int number,  int index, bool isVoted, ColorUI colorUI)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in Constructor");
            }

            currentColor = colorUI;
            this.Number = number;
            this.Index = index;
            this.Voted = isVoted;
            
            Aspect = Aspect.Fill;
            HorizontalOptions = LayoutOptions.Start;
            VerticalOptions = LayoutOptions.Center;

            byte[] imageBytes = Convert.FromBase64String(GetLetter((Letters)this.Index, this.Voted, currentColor));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change if is Voted
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="isVoted"></param>
        public void ChangeVoted(string hash, bool isVoted)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in ChangeColor");
            }

            this.Voted = isVoted;

            byte[] imageBytes = Convert.FromBase64String(GetLetter((Letters)this.Index, this.Voted, currentColor));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change ColorUI of LetterImage
        /// </summary>
        /// <param name="hash"></param>
        /// <param name="color"></param>
        public void ChangeColor(string hash, ColorUI color)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in ChangeColor");
            }

            currentColor = color;

            byte[] imageBytes = Convert.FromBase64String(GetLetter((Letters)this.Index, this.Voted, currentColor));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

